/**
* @param {Uint8Array} image_bytes
* @param {any} settings
* @returns {WfcData}
*/
export function build_from_json_settings(image_bytes: Uint8Array, settings: any): WfcData;
export interface PlayerSettings {
    tile_size: UVec2;
    output_dimensions: UVec2;
    pattern_method: PatternMethod;
    adjacency_method: AdjacencyMethod;
}

export interface Config {
    tile_size: UVec2;
    adjacency_method: AdjacencyMethod;
    pattern_method: PatternMethod;
}

export type PatternMethod = "overlapping" | "tiled";

export type AdjacencyMethod = "adjacency" | { edge: EdgeMethod };

export type EdgeMethod = "perfect" | "adjacent" | "flip";

/**
* The public interface between the javascript frontend and the winit
* event loop controlling the canvas displaying wfc for the current model
*
* * `event_loop_proxy`: the link to the event_loop that we can send messages too
*/
export class WfcController {
  free(): void;
/**
* @param {WfcWindow} display
* @returns {WfcController}
*/
  static init(display: WfcWindow): WfcController;
/**
* @param {boolean} playing
*/
  set_playing(playing: boolean): void;
/**
* @param {WfcData} data
*/
  load_wfc(data: WfcData): void;
/**
*/
  start_wfc(): void;
/**
* @param {number} w
* @param {number} h
*/
  resize_canvas(w: number, h: number): void;
/**
* @param {Function} callback
*/
  set_done_callback(callback: Function): void;
}
/**
*/
export class WfcData {
  free(): void;
}
/**
*/
export class WfcWindow {
  free(): void;
/**
* @returns {Promise<WfcWindow>}
*/
  static new(): Promise<WfcWindow>;
/**
*/
  start_event_loop(): void;
}

